import React from "react";

class mainApp extends React.Component {
  render() {
    return (
      <div className="mb-3">
        <label for="exampleFormControlInput1" className="form-label">
          Email address
        </label>
        <input type="email" className="form-control" />
      </div>
    );
  }
}

export default mainApp;
